// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./interfaces/IMilkToken.sol";

contract Staking is ReentrancyGuard, Ownable {
    using Counters for Counters.Counter;
    
    struct StakingItem {
        uint256 itemId;
        address contractAddress;
        address owner;
        uint256 tokenId;
        uint256 lastHarvestBlock;
        uint256 totalHarvestMilk;
        bool isEnded;
    }

    struct PoolInfo {
        address contractAddress;
        uint256 allocPoint;
        uint256[] tokenIds;
        string poolName;
    }

    Counters.Counter public stakingPoolCount;
    Counters.Counter public stakingItemCount;
    IMilkToken tokenMilk;
    uint256 public milkPerBlock;
    uint256 public totalAllocPoint;
    uint256 public maxGenesisPerWallet;
    uint256 public maxCollectiblesPerWallet;
    mapping(uint256 => PoolInfo) public pools;
    mapping(uint256 => StakingItem) public items;
    mapping(address => uint256) public genesisOfUser;
    mapping(address => uint256) public collectiblesOfUser;

    event StakingItemCreated(
        uint256 itemId,
        address indexed nftContract,
        address indexed owner,
        uint256 tokenId
    );

    event Harvest(
        uint256 itemId,
        address indexed owner,
        uint256 amount
    );

    constructor(IMilkToken _tokenMilk, uint256 _milkPerBlock) {
        tokenMilk = _tokenMilk;
        milkPerBlock = _milkPerBlock * 10 ** 6;
        totalAllocPoint = 0;
        maxGenesisPerWallet = 5;
        maxCollectiblesPerWallet = 10;
    }

    function setMilkPerBlock(uint256 _milkPerBlock) public onlyOwner {
        require(
            _milkPerBlock > 0,
            "milkPerBlock must be greater than zero"
        );
        milkPerBlock = _milkPerBlock * 10 ** 6;
    }

    function setMaxGenesisPerWallet(uint256 _value) public onlyOwner {
        require(
            _value > 0,
            "value must be greater than zero"
        );
        maxGenesisPerWallet = _value;
    }

    function setMaxCollectiblesPerWallet(uint256 _value) public onlyOwner {
        require(
            _value > 0,
            "value must be greater than zero"
        );
        maxCollectiblesPerWallet = _value;
    }

    function addPool(address _contractAddress, uint256 _allocPoint, uint256[] calldata _tokenIds, string memory _poolName) public onlyOwner {
        stakingPoolCount.increment();
        uint256 poolId = stakingPoolCount.current();

        pools[poolId] = PoolInfo(
            _contractAddress,
            _allocPoint,
            _tokenIds,
            _poolName
        );

        totalAllocPoint = totalAllocPoint + _allocPoint;
    }

    function updatePool(
        uint256 _poolId, 
        address _contractAddress, 
        uint256 _allocPoint, 
        uint256[] calldata _tokenIds, 
        string memory _poolName
    ) public onlyOwner {
        require(_poolId <= stakingPoolCount.current(), "invalid poolId");

        totalAllocPoint = totalAllocPoint - pools[_poolId].allocPoint;

        pools[_poolId] = PoolInfo(
            _contractAddress,
            _allocPoint,
            _tokenIds,
            _poolName
        );

        totalAllocPoint = totalAllocPoint + _allocPoint;
    }

    modifier isValid(address _msgSender, address _contractAddress, uint256 _tokenId) {
        require(IERC721(_contractAddress).ownerOf(_tokenId) == _msgSender, "not owner");
        require(genesisOfUser[_msgSender] <= maxGenesisPerWallet, "already staked maximum number of genesis");
        require(collectiblesOfUser[_msgSender] <= maxCollectiblesPerWallet, "already staked maximum number of collectibles");

        _;
    }

    function stake(
        address _nftContract,
        uint256 _tokenId
    ) public nonReentrant isValid(msg.sender, _nftContract, _tokenId) {
        stakingItemCount.increment();
        uint256 itemId = stakingItemCount.current();

        items[itemId] = StakingItem(
            itemId,
            _nftContract,
            msg.sender,
            _tokenId,
            block.number,
            0,
            false
        );

        IERC721(_nftContract).transferFrom(msg.sender, address(this), _tokenId);
        
        if(isGenesisNFT(itemId)) genesisOfUser[msg.sender] ++;

        else collectiblesOfUser[msg.sender] ++;

        emit StakingItemCreated(
            itemId,
            _nftContract,
            msg.sender,
            _tokenId
        );
    }

    function getAllocPoint(uint256 _itemId) internal view returns(uint256) {
        for(uint256 i = 1; i <= stakingPoolCount.current(); i++) {
            if (pools[i].contractAddress == items[_itemId].contractAddress) {
                return pools[i].allocPoint;
            }
        }
        return 0;
    }

    function isGenesisNFT(uint256 _itemId) internal view returns(bool) {
        for(uint256 i = 1; i <= stakingPoolCount.current(); i++) {
            if (pools[i].contractAddress == items[_itemId].contractAddress) {
                if(pools[i].tokenIds.length != 0)
                    return true;
                else
                    return false;
            }
        }
        return false;
    }

    function _harvest(
        uint256 _itemId,
        address _owner
    ) internal {
        StakingItem storage item = items[_itemId];
        require(_itemId <= stakingItemCount.current(), "invalid Item Id");
        require(_owner == items[_itemId].owner, "Not owner of this Item" );
        require(item.lastHarvestBlock < block.number, "not ready to harvest");

        uint256 amount = milkPerBlock * getAllocPoint(_itemId) / totalAllocPoint * (block.number - item.lastHarvestBlock);

        require(tokenMilk.balanceOf(address(this)) >= amount, "insufficient Milk amount to harvest");

        tokenMilk.transfer(item.owner, amount * 10 ** 12);

        item.lastHarvestBlock = block.number;

        emit Harvest(_itemId, item.owner, amount);
    }

    function harvest(uint256 _poolId) public {
        for(uint256 i = 1; i <= stakingItemCount.current(); i ++) {
            if(items[i].owner == msg.sender && items[i].isEnded == false && pools[_poolId].contractAddress == items[i].contractAddress) {
                _harvest(i, msg.sender);
            }
        }
    }

    function getStakedItems(address _owner) public view returns(StakingItem[] memory){
        uint256 totalItemCount = stakingItemCount.current();
        uint256 itemCount = 0;
        uint256 currentIndex = 0;

        for(uint256 i = 1; i <= totalItemCount; i ++) {
            if(_owner == items[i].owner && items[i].isEnded == false) {
                itemCount += 1;
            }
        }

        StakingItem[] memory stakedItems = new StakingItem[](itemCount);
    
        for (uint256 i = 1; i <= totalItemCount; i ++) {
            if(_owner == items[i].owner && items[i].isEnded == false) {
                StakingItem storage currentItem = items[i];
                stakedItems[currentIndex] = currentItem;
                currentIndex += 1;
            }
        }

        return stakedItems;

    }

    function getPendingMilk(uint256 _itemId) public view returns(uint256){
        StakingItem storage item = items[_itemId];
        uint256 amount = milkPerBlock * getAllocPoint(_itemId) / totalAllocPoint * (block.number - item.lastHarvestBlock);
        return amount;
    }

    function getPendingMilkForAll(address _owner, uint256 _poolId) public view returns(uint256) {
        uint256 totalMilkReward = 0;
        for(uint256 i = 1; i <= stakingItemCount.current(); i ++) {
            if(items[i].owner == _owner && items[i].isEnded == false && pools[_poolId].contractAddress == items[i].contractAddress) {
                totalMilkReward += milkPerBlock * getAllocPoint(i) / totalAllocPoint * (block.number - items[i].lastHarvestBlock);
            }
        }
        return totalMilkReward;
    }
    
    function getBlockNumber() public view returns(uint256) {
        return block.number;
    }

    function getTotalStakedCount(uint256 _poolId) public view returns(uint256) {
        uint256 count = 0;
        for(uint256 i = 1; i <= stakingItemCount.current(); i ++)
        {
            if(items[i].isEnded == false && items[i].contractAddress == pools[_poolId].contractAddress) {
                count ++;
            }
        }
        return count;
    }

    function getTotalMilkPower(uint256 _poolId) public view returns(uint256) {
        uint256 count = getTotalStakedCount(_poolId);
        uint256 totalMilkPower =  count * pools[_poolId].allocPoint * milkPerBlock / totalAllocPoint;
        return totalMilkPower;
    }

    function getMyMilkPower(uint256 _poolId, address _owner) public view returns(uint256) {
        uint256 count = 0;
        for(uint256 i = 1; i <= stakingItemCount.current(); i ++)
        {
            if(items[i].isEnded == false && items[i].contractAddress == pools[_poolId].contractAddress && items[i].owner == _owner) {
                count ++;
            }
        }
        uint256 myMilkPower =  count * pools[_poolId].allocPoint * milkPerBlock / totalAllocPoint;
        return myMilkPower;
    }

    function getDailyMilkRate(uint256 _poolId) public view returns(uint256) {
        uint256 totalMilkPower = getTotalMilkPower(_poolId);
        uint256 dailyRate = 0;
        if(totalMilkPower != 0)
            dailyRate = milkPerBlock * 20 * 60 * 24 * 100 / totalMilkPower;
        return dailyRate;
    }

    function getLastHarvestBlock(uint256 _itemId) public view returns(uint256) {
        StakingItem storage item = items[_itemId];
        return item.lastHarvestBlock;
    }

    function unstake(
        uint256 _itemId,
        uint256 _poolId
    ) public {
        StakingItem storage item = items[_itemId];

        require(item.owner == msg.sender, "you are not owner");
        require(item.isEnded == false, "This Staking Item was unstaked already!");
        _harvest(_itemId, msg.sender);
        IERC721(item.contractAddress).transferFrom(address(this), msg.sender, item.tokenId);
        item.isEnded = true;
        if(_poolId == 1) maxCollectiblesPerWallet --;
        else if(_poolId == 2) maxGenesisPerWallet --;
    }
}
